IF OBJECT_ID('dbo.proc_transform_149', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_149;
GO
CREATE PROCEDURE dbo.proc_transform_149
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_149
    SET payload = LEFT(payload, 1000) + N'|V4-149|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_149;
END
